import React from 'react';

const post = (props)=>(
    <div>
        <h5>{props.name}</h5>
        <img src={props.image} alt=""/>
        <button >fav</button>
        <style jsx>
        {`
            h5{
                color: blue;
            }
            img {
                max-width: 100%;
                height: auto;
            }
            div {
                display: flex;
                justify-content: space-between;
                align-items: center;
                margin: 5px 0;
            }
            @media (max-width: 600px) {
                div {
                    background: white;
                }
                img{
                    max-width:auto;
                }
            }
        `}    
        </style>

    </div>
);



export default post;
